import React from 'react';
import { Link } from 'react-router-dom';

function Register() {
 const handleSubmit =(event)=>{
  event.preventDefault(); // Prevent default form submission

  // Capture form values using the form elements
  const formData = {
    name: event.target.name.value,
    email: event.target.email.value,
    password: event.target.password.value,
  };

  // You can now use formData for further processing (e.g., sending to an API)
  console.log(formData);
 } 

  return (
    <div className='authentication '>
      <div className='authenticationForm card p-3'>
        <h1 className='card-title' >Register</h1>
        <form onSubmit={handleSubmit} >
        <div className="form-group">
            <label htmlFor="name">Name</label>
            <input type="text" className="form-control" id="name" placeholder="Name"/>
          </div>
          <div className="form-group">
            <label htmlFor="Email">Email address</label>
            <input type="email" className="form-control" id="email" aria-describedby="emailHelp" placeholder="Enter email"/>
          </div>
          <div className="form-group">
            <label htmlFor="Password">Password</label>
            <input type="password" className="form-control" id="Password" placeholder="Password"/>
          </div>
          <button   type="submit" className="btn btn-primary">Register</button>
          <Link to='/login' className='anchor'  > GO TO LOGIN </Link>
        </form>
      </div>
    </div>
  );
}

export default Register;
